import logo from './logo.svg';
import './App.css';
import Home from './components/Home';
import Category from './components/Category';

import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  const allCategories = ["career", "academics", "romance", "friendships", ""]
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={<Home />}
        />
        <Route
          path="/career"
          element={<Category category="Career" />}
        />
        <Route
          path="/academic"
          element={<Category category="Academic" />}
        />
      </Routes>
    </BrowserRouter>
  );
}



export default App;
